import React, { useState } from "react";

import './Login.css';

const Login = () => {

  return (
    <>
      <div>
        <div2>
          <span className="login">Log in</span>
          <p1>Enter you details below</p1>

          <button className="btn2">Continue with Facebook</button>
          <button className="btn1">Continue with Google</button>

          <span className="logi">EMAIL ADREESS <span2> * </span2></span>
          <input
            type="email"
            placeholder="Entre your Email"
          />

          <span className="logi">PASSWORD <span2> * </span2></span>

          <input
            type="password"
            placeholder="Entre your password"
          />
          <p>Forgot Your Password?</p>
          <p>Do not have an account? Create one</p>
          <button className="btn1">LOG IN</button>

        </div2>
      </div>
    </>
  );
};

export default Login;
